import {useEffect, useState} from "react";
import {Avatar,ButtonGroup, Divider, InputLabel, MenuItem, Select, Stack, TextField, Typography} from "@mui/material";
import * as React from "react";
import {CasinoOutlined, CloudUploadOutlined} from "@mui/icons-material";
import {LoadingButton} from "@mui/lab";
import {useNavigate, useParams} from "react-router-dom";

export default function PizzaAddPage(props){
    const navigate = useNavigate();
    const param = useParams();
    const [getPizza, setPizza] = useState({
        id:"0",
        name:"",
        kepURL:"",
        isGlutenFree:"0"
    });
    const [isLoadingPending, setLoadingPending] = useState(false);
    const [isNameEdited, setNameIsEdited] = useState(false);
    const [isImageEdited, setImageIsEdited] = useState(false);
    const [isUploading, setUploading] = useState(false);

    const fetchURL = "https://pizza.kando-dev.eu/Pizza/";

    useEffect(() => {
        if(param.randomMode){
            generateRandomPizza();
        }else{
            setPizza({
                id:"0",
                name:"",
                kepURL:"",
                isGlutenFree:"0"
            })
        }
    }, [window.location.href]);



    const setLoadingHandlerTrue = () => {
        setLoadingPending(true);
        props.setLoadingBackdropOpen(true);
    }

    const setLoadingHandlerFalse = () => {
        setLoadingPending(false);
        props.setLoadingBackdropOpen(false);
    }

   function generateRandomPizza(){
       setLoadingHandlerTrue()

       const randomNames = ["Koktél pizza", "Hús hússal pizza", "Amore pizza", "Zsófi és Bence pizza", "Darshan pizza", "Calzone hajtott pizza", "Három kívánság pizza", "Betyár pizza", "Szerelem pizza", "Retro pizza"]; //Köszi Bing<3
       const randomImages = {
           "Koktél pizza":[
               "https://www.smilepizza.com.ua/images/cache/1702/1_1500.jpg",
               "https://www.cavit.com/wp-content/uploads/2021/04/18_Shrimp-Cocktail-Pizza_AdobeStock_331558165_Square-1024x1024.jpeg",
               "https://i0.wp.com/weirdandwildpizza.com/wp-content/uploads/2022/11/90-shrimp-cocktail.jpg?resize=740%2C416&ssl=1"
           ],
           "Hús hússal pizza":[
               "https://cdn.falatozz.hu/kepek/receptek/000/031/400x/husos-pizza.jpg",
               "https://nlc.p3k.hu/uploads/2019/09/pizza-sandwich-japan-japanese-fast-food-omg-1.jpg",
               "https://m.blog.hu/cs/csabikonyhaja/image/dsc07644.JPG"
           ],
           "Amore pizza":[
               "https://bellavitapizzeria.hu/wp-content/uploads/2021/01/177635378_305905407609418_8462116721467886576_n.jpg",
               "https://pampalinipizzeria.hu/wp-content/uploads/2022/01/Amore.jpg",
               "https://m.onlineordersnow.com/AmorePizza/images/deluxe.jpg?crc=392547993"
           ],
           "Zsófi és Bence pizza":[
               "data:image/jpeg;base64,",
               "https://image-api.nosalty.hu/nosalty/images/recipes/x4/pW/mokas-pizzaszeletek.jpeg?w=1200&h=920&s=afc3bae3cf3cdca2d936a62556c2b53b",
               "https://blog.tefal.hu/webtemp/files/gallery/1/3/2690/1170_658_100__exact__large-actifry-genius-xl-2in1.jpg" //vicces, mert ez egy hamburger, pontosabban kettő =p
           ],
           "Darshan pizza":[
               "https://media-cdn.tripadvisor.com/media/photo-m/1280/14/e2/f3/7e/pizza-darshan.jpg",
               "data:image/jpeg;base64,",
               "https://media-assets.swiggy.com/swiggy/image/upload/f_auto,q_auto,fl_lossy/efcivxsvwjzrouuezqfg"
           ],
           "Calzone hajtott pizza":[
               "https://cdn.nwmgroups.hu/s/img/i/1709/2017091345.jpg",
               "https://1.bp.blogspot.com/-RJoIaqlONKQ/TxrVjq_YzQI/AAAAAAAAAfg/dgX5z9TM0lo/s1600/IMGP7157.JPG",
               "https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcSJj52rajBX4I4n8fIJRLNE5vyAGx0jh-IETQ&usqp=CAU"
           ],
           "Három kívánság pizza":[
               "https://grandechico.hu/wp-content/uploads/2016/10/88.jpg",
               "data:image/jpeg;base64,",
               "https://meexpizza.hu/wp-content/uploads/2021/04/3-kivansag-kukorica-bacon-sajt1-3.jpg"
           ],
           "Betyár pizza":[
               "https://www.la-rosa.hu/oroshaza/wp-content/uploads/2014/04/bety%C3%A1r.jpg",
               "https://pampalinipizzeria.hu/wp-content/uploads/2022/01/Betyar.jpg",
               "https://tubipizzeria.hu/wp-content/uploads/2021/10/Betyar-pizza.jpg"
           ],
           "Szerelem pizza":[
               "data:image/jpeg;base64,",
               "https://media.istockphoto.com/id/507570898/hu/fot%C3%B3/sz%C3%ADv-alak%C3%BA-pizza-margherita-szerelem-%C3%A9lelmiszer-szimb%C3%B3lum-mozzarella-paradicsom.jpg?s=1024x1024&w=is&k=20&c=DHnUXuTHaYIH5A7Dy71G6C0Y1dxjxUvsmOAVKqpbMC4=",
               "https://cnd.vous.hu/img/inline/egeszseges-pizza-sziv1.jpg",
               "https://ecofamily.hu/media/oander/news/article/GettyImages-1201385061_1.jpg",
               "https://marieclaire.hu/uploads/2021/02/valentin_nap-sziv-pizza-719x1024.jpg",
               "https://tse2.mm.bing.net/th/id/OIG.71BxBmIkX6.0WoXcV3zS?pid=ImgGn",
               "https://tse4.mm.bing.net/th/id/OIG.ui8JuiZyXiK7IavYW0nl?pid=ImgGn",
               "https://tse2.mm.bing.net/th/id/OIG.E6jjr8ZUtABxKl11N55P?pid=ImgGn",
               "https://tse1.mm.bing.net/th/id/OIG.88QSnstaMLPHp6uMIPPe?pid=ImgGn",
               "https://tse2.mm.bing.net/th/id/OIG.bw2aMyeoFiRbzod.w2jU?pid=ImgGn",
               "https://tse3.mm.bing.net/th/id/OIG.sSQyjXUqrOGBSS6809QO?pid=ImgGn",
               "https://tse2.mm.bing.net/th/id/OIG.nIztXPkaQAWu9mOwzjDk?pid=ImgGn",
               "https://tse3.mm.bing.net/th/id/OIG.qadGPQCCIA8bTo9y_ngb?pid=ImgGn",
               "https://tse2.mm.bing.net/th/id/OIG.1V2r9H6BUdiD4DpHIdeX?pid=ImgGn",
               "https://tse2.mm.bing.net/th/id/OIG.1V2r9H6BUdiD4DpHIdeX?pid=ImgGn",
               "https://tse4.mm.bing.net/th/id/OIG.d651wgWzcj5vBc4PhdDj?pid=ImgGn",
               "https://tse3.mm.bing.net/th/id/OIG.PxFH1OmRRnySKSUC3FPU?pid=ImgGn",
               "https://tse4.mm.bing.net/th/id/OIG.QLo36eE3a9OROcOiz1au?pid=ImgGn",
               "https://tse4.mm.bing.net/th/id/OIG.F6ThxHYZuM_HL_uHdqo8?pid=ImgGn",
               "https://tse1.mm.bing.net/th/id/OIG.U9JmsU_.il715DJODnSu?pid=ImgGn",
               "https://tse1.mm.bing.net/th/id/OIG.SIN4HHu7tRXIogxcGEE.?pid=ImgGn",
               "https://tse3.mm.bing.net/th/id/OIG.xrF.U03wM4JQy9gNTQMC?pid=ImgGn",
               "https://tse2.mm.bing.net/th/id/OIG.wfhjbifWvbE37smHkJu8?pid=ImgGn"
           ],
           "Retro pizza":[
               "https://cooltourterasse.hu/image/cache/catalog/pizza/cooltourpizza-1-500x500.png",
               "https://imageproxy.wolt.com/venue/63be6924a6441f7045587980/9b6f6fd6-959d-11ed-a347-aa827c2c3495_shutterstock_354145490.jpg",
               "data:image/jpeg;base64,"
           ]
       }
       const randomName = randomNames[Math.floor(Math.random()*randomNames.length)];

       setPizza({
           id:"0",
           name:randomName,
           kepURL:randomImages[randomName][Math.floor(Math.random()*randomImages[randomName].length)],
           isGlutenFree:"0"
       })
       setLoadingHandlerFalse()
   }

    const handleChange = (event) => {
        if(event.target.name=="name")setNameIsEdited(true)
        if(event.target.name=="kepURL")setImageIsEdited(true)
        setPizza(prevState => ({...prevState,
            [event.target.name]: event.target.value
        }));
    };

    function openSnackbar(type, message){
        props.setSnackbarType(type)
        props.setSnackbarMessage(message);
        props.setSnackbarOpen(true)
    }

    const handleSave = async() => {
        setUploading(true)
        const pizzaName = getPizza.name;
        const pizzaImageURL = getPizza.kepURL;
        
        let errors = 0;
        if(pizzaName.length < 3 || pizzaImageURL.length < 3) errors++;

        if(errors != 0){
            openSnackbar("error", "Érvénytelen értékeket észleltünk")
            setUploading(false)
        }else{
            props.setLoadingBackdropOpen(true)
            await fetch(fetchURL, {
                headers:{"Content-type":"application/json"},
                method:"POST",
                body: JSON.stringify(getPizza)
            }).then((response) => {
                openSnackbar("success", "Egyenesen a sütőből, egyből tálalva! Ez igen!")
                navigate("/")
            }).catch((error) => {
                openSnackbar("error", "Hibába ütköztünk: " + error)
            }).finally(()=>{
                setUploading(false)
                props.setLoadingBackdropOpen(false)
            });
        }
    };


    return(
        <div>
            <div>
                <Typography variant="h1">Új pizza</Typography>
                <Typography gutterBottom>Nyami nyami</Typography>
            </div>

            <div style={{display: "flex"}}>
                <div style={{marginInline: "40px"}}>
                    <Avatar sx={{borderRadius: "16px", width: "545px", height: "343px"}} alt="X" src={getPizza.kepURL.length>0?getPizza.kepURL:"d"}></Avatar>

                    <div style={{marginTop: "40px"}}>
                        <ButtonGroup variant="outlined" aria-label="loading button group">
                            <LoadingButton disabled={isUploading} onClick={()=>{generateRandomPizza()}} color="secondary" startIcon={<CasinoOutlined/>}>Véletlenszerűsítés</LoadingButton>
                            <LoadingButton disabled={isUploading} onClick={handleSave} loading={isUploading} loadingPosition="start" startIcon={<CloudUploadOutlined/>}>Elkészült a pizza</LoadingButton>
                        </ButtonGroup>
                    </div>
                </div>

                <div style={{flex: "5", marginRight: "40px"}}>
                    <Stack direction="column" divider={<Divider orientation="vertical" flexItem/>} spacing={2}
                           sx={{textAlign: "left"}}>
                        <div>
                            <Typography gutterBottom>Név</Typography>
                            <TextField error={isNameEdited?getPizza.name.length<3:false} required name="name" onChange={handleChange} disabled={isUploading} value={getPizza.name} fullWidth id="pizza_name_input" label="Pizza név" variant="outlined"/>
                        </div>

                        <div>
                            <Typography gutterBottom>Kép hivatkozás</Typography>
                            <TextField error={isImageEdited?getPizza.kepURL.length<3:false} required name="kepURL" onChange={handleChange} disabled={isUploading} value={getPizza.kepURL} fullWidth id="pizza_image_url_input" label="Pizza kép" type="url" variant="outlined"/>
                        </div>

                        <div>
                            <Typography gutterBottom>Egyéb információ</Typography>
                            <InputLabel required id="pizza_is_gluten_free_input">Glutén-mentes?</InputLabel>
                            <Select
                                fullWidth
                                name="isGlutenFree"
                                disabled={isUploading}
                                labelId="pizza_gluten_mentes_label"
                                id="pizza_gluten_mentes_select"
                                value={getPizza.isGlutenFree}
                                label="Glutén-mentes?"
                                onChange={handleChange}>
                                <MenuItem value={0}>Nem</MenuItem>
                                <MenuItem value={1}>Igen</MenuItem>
                            </Select>
                        </div>

                    </Stack>
                </div>

            </div>

        </div>
    )

}